import react from "react";
import Form from "./loginForm";

function Login(props) {
  return (
    <div id="login" className="login">
      <div className="login1">
        <h1>
          Login into your <span>Keeper</span> account
        </h1>
        <Form
          pA={props.paA}
          s={props.sA}
          eA={props.emA}
          s1={props.sA1}
          l={props.Login}
          t={props.text}
          sT={props.sText}
        ></Form>
      </div>
    </div>
  );
}

export default Login;
